import axios from "axios"
import { URL_EMAIL_APERTURA_CONTO, URL_EMAIL_BENEVENUTO } from "../utility/Endpoint"



export async function emailBenvenuto(utente){
    return await axios.post(URL_EMAIL_BENEVENUTO,utente).then((response) =>{
      if(response.status==200){
        alert("email status 200")
      }
    }).catch((error )=>{
      alert("catch email")
      console.log(error)
  
    })
  }

  export async function emailAperturaConto(utente){
    return await axios.post(URL_EMAIL_APERTURA_CONTO,utente).then((response)=>{
        alert(response)

    }).catch((error)=>{
        alert("catch email")
        console.log(error)
    })
  }
